pragma solidity ^0.4.25;

// It's important to avoid vulnerabilities due to numeric overflow bugs
// OpenZeppelin's SafeMath library, when used correctly, protects agains such bugs
// More info: https://www.nccgroup.trust/us/about-us/newsroom-and-events/blog/2018/november/smart-contract-insecurity-bad-arithmetic/

import "../node_modules/openzeppelin-solidity/contracts/math/SafeMath.sol";
import "./FlightSuretyData.sol";

/************************************************** */
/* FlightSurety Smart Contract                      */
/************************************************** */
contract FlightSuretyApp   {
    using SafeMath for uint256; // Allow SafeMath functions to be called for all uint256 types (similar to "prototype" in Javascript)

    /********************************************************************************************/
    /*                                       DATA VARIABLES                                     */
    /********************************************************************************************/
    // Setup the multi sig constant

    bool private operational = true;
    FlightSuretyData flightSuretyData;  
    uint constant M = 4; // Treshold number in order to sign a tx
    uint multiCalls = 1; // Start to one because one airline is directly registered
    bool private vote_status = false; 

    // Flight status codees
    uint8 private constant STATUS_CODE_UNKNOWN = 0;
    uint8 private constant STATUS_CODE_ON_TIME = 10;
    uint8 private constant STATUS_CODE_LATE_AIRLINE = 20;
    uint8 private constant STATUS_CODE_LATE_WEATHER = 30;
    uint8 private constant STATUS_CODE_LATE_TECHNICAL = 40;
    uint8 private constant STATUS_CODE_LATE_OTHER = 50;

    address private contractOwner;          // Account used to deploy contract

    struct Flight {
        bool isRegistered;
        uint8 statusCode;
        uint256 updatedTimestamp;        
        address airline;
    }
    mapping(bytes32 => Flight) private flights;


    /********************************************************************************************/
    /*                                       EVENT DEFINITIONS                                  */
    /********************************************************************************************/



   //Fire each time an airline is register  
   event AirlineRegistered(address account);
   //Fire each time an airline is refused   
   event AirlineNotRegistered(address account, uint256 score);
   //Fire each time an airline funded the seed fee   
   event FundedSeed(address funder, uint256 seedFee);
   //Fire each time a passenger subscribe to an insurance
   event InsuranceSubscribed(address airline, address sender, uint256 share);
   //
   event passengerCreditProccesed(address airline, address passenger, uint256 credit);
   event Withdraw(address sender ,uint256 value);
    /********************************************************************************************/
    /*                                       FUNCTION MODIFIERS                                 */
    /********************************************************************************************/

    // Modifiers help avoid duplication of code. They are typically used to validate something
    // before a function is allowed to be executed.

    /**
    * @dev Modifier that requires the "operational" boolean variable to be "true"
    *      This is used on all state changing functions to pause the contract in 
    *      the event there is an issue that needs to be fixed
    */

    modifier requireisOperational() 
    {
         // Modify to call data contract's status
        require(operational, "Contract is currently not operational");  
        _;  // All modifiers require an "_" which indicates where the function body will be added
    }

    /**
    * @dev Modifier that requires the "ContractOwner" account to be the function caller
    */
    modifier requireContractOwner()
    {
        require(msg.sender == contractOwner, "Caller is not contract owner");
        _;
    }
    /**
    * @dev Modifier that requires the "airline" account to be a valid  caller
    */
    modifier requireisAirline(address airline)
    {
    	require(airline != contractOwner, "'account' must be a valid address."); // check with address(0)
    	 _;
    }   
    /**
    * @dev Modifier that requires the "airlineSender" account to be not yet registered
    */
    modifier requireisNotRegistered(address airlineSender)
    {
        require(!flightSuretyData.getAirlineRegisterStatus(airlineSender), "Already registered");
    	 _;
    }
    /**
    * @dev Modifier that requires that the amount send must be right
    */        
    modifier requireIsCorrectAmount()
    {
        require(msg.value == flightSuretyData.getAirlineRegistrationFee(),"the seed fees is not right re-check the contract");
    	 _;
    }
    /**
    * @dev Modifier that requires the "msg.send" to be not yet funded
    */
    modifier requireIsNotFunded()
    {
        require(!flightSuretyData.getAirlineFundingStatus(msg.sender), "Airline's already funded");
         _;
    }
    /**
    * @dev Modifier that requires the "msg.send" to funded the seed participation
    */
    modifier requireIsFunded()
    {
        require(flightSuretyData.getAirlineFundingStatus(msg.sender), "To participate to the registration approval, you Must fund the seed participation");
         _;
    }
    /**
    * @dev Modifier that requires that insurance subscribtion amount be in the specified range
    */
    modifier requireAmountIsInRange()
    {
        require((msg.value > 0 ether) && (msg.value <= 1 ether), "Insurance value must be in the range of ]0,1]");
         _;
    }







    /********************************************************************************************/
    /*                                       CONSTRUCTOR                                        */
    /********************************************************************************************/

    /**
    * @dev Contract constructor
    *
    */
    constructor
                                (
                                address flightSuretyDataContract
                                ) 
                                public 
    {
        contractOwner = msg.sender;

        flightSuretyData = FlightSuretyData(flightSuretyDataContract);
        flightSuretyData.registerAirline("TWA","AM757",true,true,0x0C0b6847Afd923c7c39Ae185ceF946318b82083a);

        emit AirlineRegistered(contractOwner);
    }

    /********************************************************************************************/
    /*                                       UTILITY FUNCTIONS                                  */
    /********************************************************************************************/

   /**
    * @dev check if the data contract is operational
    *
    */
    function isOperational() 
                            public 
                            pure 
                            returns(bool) 
    {
        return true;  // Modify to call data contract's status
    }

    /********************************************************************************************/
    /*                                     SMART CONTRACT FUNCTIONS                             */
    /********************************************************************************************/


   /**
    * @dev Add an airline to the registration queue using multiparty consensus when airlines numbers is over 4
    *
    */   
    function MultiPartyRegisterAirline
                            (
                            string companyName, string IATA, bool registered,address airline
                            )
                            external  
                            requireisOperational
                            requireisAirline(airline)
                            requireisNotRegistered(airline)
                            requireIsFunded

                            returns(bool)                      
    {

        uint8 randomVote = uint8(uint256(keccak256(abi.encodePacked(block.timestamp, block.difficulty)))%M); //To mimic the vote of Validators aka airlines already registered


        //uint multicallLength = flightSuretyData.getMultiCallsLength();


        if (multiCalls < M){
            // No round validator need to register  the airline
            flightSuretyData.registerAirline(companyName, IATA, registered, false, airline);
            emit AirlineRegistered(airline);
            multiCalls +=1;
            return(true);  // Registered without round vote
        } else {


                if(randomVote >= multiCalls.div(2)){
                    // Airline is accepted
                    flightSuretyData.registerAirline(companyName, IATA, registered, false, airline);
                    emit AirlineRegistered(airline);
                    multiCalls +=1;
                    return(true);             

                }else{
                    // Airline is refused
                    return(false); 
                }           
        }

    }


    /**
    * @dev Initial funding for the insurance. Unless there are too many delayed flights
    *      resulting in insurance payouts, the contract should be self-sustaining
    *
    */ 

    function seedFunding
                (
                )
                public
                payable
                requireisOperational
                requireIsCorrectAmount
                requireIsNotFunded
    {
        flightSuretyData.sendFund(contractOwner, msg.value);
        emit FundedSeed(msg.sender, msg.value);
    }



     /**
    * @dev Subscribe to an insurance for a flight
    *
    */   
    function setInsurance
                            (
                                address airline

                            )
                            external
                            payable
                            requireisOperational
                            requireAmountIsInRange

    {

        flightSuretyData._setInsurance(airline, msg.sender, msg.value);

        emit InsuranceSubscribed(airline, msg.sender, msg.value);

    }

    /**
     *  @dev Transfers eligible payout funds to insuree
     *
    */
    function withdraw
                            (
                            )
                            external
                            requireisOperational

    {
        //require(flightSuretyData.getPassengerCredit(msg.sender) > 0, "No balance to withdraw");

        uint256 withdraw_value = flightSuretyData._withdraw(msg.sender);
        // Transfer credit to passenger wallet
        msg.sender.transfer(withdraw_value);

        emit Withdraw(msg.sender,withdraw_value);


    }

    function getAirlinesInfo
    				(
    				//address airline
    				)
    				external
    				requireisOperational
    				returns ( string memory, string memory)

    {
    string memory companyName;
    string memory IATA;

    (companyName,IATA) = flightSuretyData._getAirlinesInfo();
    return (companyName, IATA);
    }


   /**
    * @dev Called after oracle has updated flight status
    *
    */  
    function processFlightStatus
                                (
                                    address airline,
                                    string memory flight,
                                    uint256 timestamp,
                                    uint8 statusCode
                                )
                                internal

    {
         address passenger;
         uint256 share;
         (passenger,share) = flightSuretyData.getInsuredIndexPassengers(airline);

         require((passenger != address(0)) && (airline != address(0)), "passenger & airline address must be valide.");
         require(share > 0, "Passenger did not subscrib for insurance.");

         // Only credit if flight delay is airline fault (airline late and late due to technical)
         if((statusCode == STATUS_CODE_LATE_AIRLINE) || (statusCode == STATUS_CODE_LATE_TECHNICAL)){
            uint256 credit = share.mul(3).div(2);

            flightSuretyData.setCreditInsurance(airline, passenger, credit);
            emit passengerCreditProccesed(airline, passenger, credit);


        }
    }






   /**
    * @dev Generate a request for oracles to fetch flight information
    *
    */
    function fetchFlightStatus
                        (
                            address airline,
                            string flight,
                            uint256 timestamp                            
                        )
                        external
    {
        uint8 index = getRandomIndex(msg.sender);

        // Generate a unique key for storing the request
        bytes32 key = keccak256(abi.encodePacked(index, airline, flight, timestamp));
        oracleResponses[key] = ResponseInfo({
                                                requester: msg.sender,
                                                isOpen: true
                                            });

        emit OracleRequest(index, airline, flight, timestamp);
    } 


// region ORACLE MANAGEMENT

    // Incremented to add pseudo-randomness at various points
    uint8 private nonce = 0;    

    // Fee to be paid when registering oracle
    uint256 public constant REGISTRATION_FEE = 1 ether;

    // Number of oracles that must respond for valid status
    uint256 private constant MIN_RESPONSES = 3;


    struct Oracle {
        bool isRegistered;
        uint8[3] indexes;        
    }

    // Track all registered oracles
    mapping(address => Oracle) private oracles;

    // Model for responses from oracles
    struct ResponseInfo {
        address requester;                              // Account that requested status
        bool isOpen;                                    // If open, oracle responses are accepted
        mapping(uint8 => address[]) responses;          // Mapping key is the status code reported
                                                        // This lets us group responses and identify
                                                        // the response that majority of the oracles
    }

    // Track all oracle responses
    // Key = hash(index, flight, timestamp)
    mapping(bytes32 => ResponseInfo) private oracleResponses;

    // Event fired each time an oracle submits a response
    event FlightStatusInfo(address airline, string flight, uint256 timestamp, uint8 status);

    event OracleReport(address airline, string flight, uint256 timestamp, uint8 status);

    // Event fired when flight status request is submitted
    // Oracles track this and if they have a matching index
    // they fetch data and submit a response
    event OracleRequest(uint8 index, address airline, string flight, uint256 timestamp);


    // Register an oracle with the contract
    function registerOracle
                            (
                            )
                            external
                            payable
    {
        // Require registration fee
        require(msg.value >= REGISTRATION_FEE, "Registration fee is required");

        uint8[3] memory indexes = generateIndexes(msg.sender);

        oracles[msg.sender] = Oracle({
                                        isRegistered: true,
                                        indexes: indexes
                                    });
    }

    function getMyIndexes
                            (
                            )
                            view
                            external
                            returns(uint8[3])
    {
        require(oracles[msg.sender].isRegistered, "Not registered as an oracle");

        return oracles[msg.sender].indexes;
    }




    // Called by oracle when a response is available to an outstanding request
    // For the response to be accepted, there must be a pending request that is open
    // and matches one of the three Indexes randomly assigned to the oracle at the
    // time of registration (i.e. uninvited oracles are not welcome)
    function submitOracleResponse
                        (
                            uint8 index,
                            address airline,
                            string flight,
                            uint256 timestamp,
                            uint8 statusCode
                        )
                        external
    {
        require((oracles[msg.sender].indexes[0] == index) || (oracles[msg.sender].indexes[1] == index) || (oracles[msg.sender].indexes[2] == index), "Index does not match oracle request");


        bytes32 key = keccak256(abi.encodePacked(index, airline, flight, timestamp)); 
        require(oracleResponses[key].isOpen, "Flight or timestamp do not match oracle request");

        oracleResponses[key].responses[statusCode].push(msg.sender);

        // Information isn't considered verified until at least MIN_RESPONSES
        // oracles respond with the *** same *** information
        emit OracleReport(airline, flight, timestamp, statusCode);
        if (oracleResponses[key].responses[statusCode].length >= MIN_RESPONSES) {

            emit FlightStatusInfo(airline, flight, timestamp, statusCode);

            // Handle flight status as appropriate
            processFlightStatus(airline, flight, timestamp, statusCode);
        }
    }


    function getFlightKey
                        (
                            address airline,
                            string flight,
                            uint256 timestamp
                        )
                        pure
                        internal
                        returns(bytes32) 
    {
        return keccak256(abi.encodePacked(airline, flight, timestamp));
    }



    // Returns array of three non-duplicating integers from 0-9
    function generateIndexes
                            (                       
                                address account         
                            )
                            internal
                            returns(uint8[3])
    {
        uint8[3] memory indexes;
        indexes[0] = getRandomIndex(account);

        indexes[1] = indexes[0];
        while(indexes[1] == indexes[0]) {
            indexes[1] = getRandomIndex(account);
        }

        indexes[2] = indexes[1];
        while((indexes[2] == indexes[0]) || (indexes[2] == indexes[1])) {
            indexes[2] = getRandomIndex(account);
        }

        return indexes;
    }

    // Returns array of three non-duplicating integers from 0-9
    function getRandomIndex
                            (
                                address account
                            )
                            internal
                            returns (uint8)
    {
        uint8 maxValue = 10;

        // Pseudo random number...the incrementing nonce adds variation
        uint8 random = uint8(uint256(keccak256(abi.encodePacked(blockhash(block.number - nonce++), account))) % maxValue);

        if (nonce > 250) {
            nonce = 0;  // Can only fetch blockhashes for last 256 blocks so we adapt
        }

        return random;
    }

// endregion


}

